import React from "react"
class Form extends React.Component{
    constructor(){
        super();
        this.state={
            username:"",
            email:"",
            pswd:"",
            cpswd:""
        }
    }
    updatedUser=(e)=>{
        this.setState({
            user:e.target.value
        })
    }
    updatedEmail=(e)=>{
        this.setState({
            email:e.target.value
        })
    }
    updatedPassword=(e)=>{
        this.setState({
            pswd:e.target.value
        })
    }
    updatedCpassword=(e)=>{
        this.setState({
            cpswd:e.target.value
        })
    }
    render(){
        return(
            <div>
                <form>
                    <label>Username:</label>
                    <input value={this.state.username}type="text" onChange={this.updateUser}/>
                    <br/><br/>
                    <label>Email</label>
                    <input value={this.state.email} type="email" onChange={this.updateEmail}/>
                    <br/><br/>
                    <label>Password</label>
                    <input value={this.state.pswd} type="password" onChange={this.updatePassword}/>
                    <br/><br/>
                    <label>confirmPassword</label>
                    <input value={this.state.cpswd} type="password" onChange={this.updatedCpassword}/>
                    <br/><br/>
                    <input type="submit" value="Registered"/>
                </form>
            </div>
        )
    }
}
export default Form;
